//import Dashboard from "views/Dashboard.js";
import Traffic from "views/Traffic/Traffic";

//import Emissions from "views/Emissions.js";
import DfeIssuance from "views/Issuance/DfeIssuance";
import Notifications from "views/Notification/Notifications";
import Maps from "views/Maps.js";
import Warnings from "views/Warnings/Warnings";
import Camera from "views/Camera.js";
import Auditors from "views/Auditors.js";
import Groups from "views/Groups.js";
import InfoVehicles from "views/Vehicles";
import PoliceCar from "views/PoliceCars.js";
//import InfoPeoples from "views/Peoples";
import InfoCompanys from "views/Companys";
import { mountViews  } from "views/ViewsCreator";


import {
  RiGroupFill,
  RiUserFill,
  RiRoadMapFill,
  RiFileList3Fill,
  RiFileWarningFill,
  RiVidiconFill,
  RiCarFill,
  RiBuilding4Fill,
  RiNotification3Fill,
  RiBarChart2Fill,
  RiPoliceCarFill // Police Car
} from "react-icons/ri";
import Status from "views/Status";
// RiDashboardFill, RiUserSearchFill


var routes = [
  //{
  //  path: "/dashboard",
  //  name: "Dashboard",
  //  icon: RiDashboardFill,
  //  component: Dashboard,
  //  layout: "/admin",
  //  refreshable: true
  //},
  {
    path: "/tables",
    name: "Tabela de Alertas e Tráfego",
    icon: RiFileList3Fill,
    component: Traffic,
    layout: "/admin",
    refreshable: true,
    visible: true
  },
  {
    path: "/issuance",
    name: "Tabela de Emissões de DFe",
    icon: RiFileList3Fill,
    component: DfeIssuance,
    layout: "/admin",
    refreshable: true,
    visible: true
  },
  // {
  //   path: "/search",
  //   name: "Busca de Alertas",
