  //   component: Search,
  //   layout: "/admin",
  //   refreshable: false
  // },
  {
    path: "/maps",
    name: "Mapa",
    icon: RiRoadMapFill,
    component: Maps,
    layout: "/admin",
    refreshable: false,
    visible: true
  },
  {
    path: "/warnings",
    name: "Configurar Alertas",
    icon: RiFileWarningFill,
    component: Warnings,
    layout: "/admin",
    refreshable: true,
    visible: true
  },
  {
    path: "/notifications",
    name: "Notificações",
    icon: RiNotification3Fill,
    component: Notifications,
    layout: "/admin",
    refreshable: true,
    visible: true
  },

  {
    path: "/cameras",
    name: "Gerenciar Câmeras",
    icon: RiVidiconFill,
    component: Camera,
    layout: "/admin",
    refreshable: true,
    visible: true
  },

  {
    path: "/auditors",
    name: "Gerenciar Auditores",
    icon: RiUserFill,
    component: Auditors,
    layout: "/admin",
    refreshable: true,
    visible: true
  },

